const url = "";

const Loading = () => {
  return (
    <div>
      <h3>Loading...</h3>
    </div>
  );
};

const Cats = ()=>{
    return(
        <div>hello kitten</div>
    )
}

export const CatApi = () => {
  const [Loading, setLoading] = useState(true);
  const [Cats, setCats] = useState([]);
  if (Loading) {
    return (
      <div>
        <Loading></Loading>
      </div>
    );
  } else {
    return(
    <div>
        <Cats></Cats>
    </div>);
  }
};
